import React from 'react';
import ReactDOM from 'react-dom';
import Sketch from 'react-p5';
import {BrowserRouter, Route, Link} from 'react-router-dom';
import 'bulma/css/bulma.css'
import Particles from './Particles';
import Snowflake from './Snowflake';

class First extends React.Component {
  render() {
    return(
      <div className="section">
        <h2 className="title">Particles</h2>
        <Particles />
      </div>
    );
  }
}

class Second extends React.Component {
  render() {
    return(
      <div className="section">
        <h2 className="title">Particles</h2>
        <Snowflake />
      </div>
    );
  }
}

class Contact extends React.Component {
  render() {
    return(
      <div className="section">
        <h2 className="title">Contact Us</h2>
        <img src="https://picsum.photos/400/300"/>
      </div>
    );
  }
}

ReactDOM.render(
  <BrowserRouter>
    <div>
    <nav className="navbar" role="navigation" aria-label="main navigation">
        <ul className="navbar-start">
            <li className="navbar-item"><Link to="/">Particles</Link></li>
            <li className="navbar-item"><Link to="/snowflake">Snowflakes</Link></li>
            <li className="navbar-item"><Link to="/contact">Contact Us</Link></li>
        </ul>
    </nav>
        <hr/>
        <Route exact path="/" component={First}/>
        <Route exact path="/snowflake" component={Snowflake}/>
        <Route exact path="/contact" component={Contact}/>
    </div>
  </BrowserRouter>,
  document.getElementById('root')
);
